#
# Structure for table "patients"
#

DROP TABLE IF EXISTS `patients`;
CREATE TABLE `patients` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `numberhistory` varchar(8) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `lastname` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `patient` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `typedocument_id` int(10) unsigned NOT NULL,
  `dni` varchar(8) COLLATE utf8_unicode_ci NOT NULL,
  `sex` enum('H','M') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'H',
  `birthdate` date DEFAULT NULL,
  `catchment_id` int(10) unsigned NOT NULL,
  `ubigeo_id` int(10) unsigned DEFAULT '1',
  `address` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `email` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `telephone` varchar(7) CHARACTER SET utf8 DEFAULT NULL,
  `cellphone` varchar(9) CHARACTER SET utf8 DEFAULT NULL,
  `photo` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT 'no-image.png',
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `patients_numberhistory_unique` (`numberhistory`),
  UNIQUE KEY `patients_dni_unique` (`dni`),
  KEY `patients_typedocument_id_foreign` (`typedocument_id`),
  KEY `patients_catchment_id_foreign` (`catchment_id`),
  KEY `patients_ubigeo_id_foreign` (`ubigeo_id`),
  CONSTRAINT `patients_catchment_id_foreign` FOREIGN KEY (`catchment_id`) REFERENCES `catchment` (`id`) ON DELETE CASCADE,
  CONSTRAINT `patients_typedocument_id_foreign` FOREIGN KEY (`typedocument_id`) REFERENCES `typedocuments` (`id`) ON DELETE CASCADE,
  CONSTRAINT `patients_ubigeo_id_foreign` FOREIGN KEY (`ubigeo_id`) REFERENCES `ubigeos` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

